import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import female12 from '../../src/images/female12.png'

export default class FemalePics extends Component {
    constructor() {
        super()

        this.setState = {
            bodyFat12: .12,
            bodyFat15: .15,
            bodyFat25: .25

        }
    }


    render() {
        return (
            <div>
                <Link to={{
                    pathname: '/input',
                    state: this.state.female12
                    }}> <img src="{female12}" alt="" />
                </Link>

            </div>
        )
    }
}
